import React from "react";
import "./styling/home.css";
import "./scripts/typewriter";
import { Button } from "@material-ui/core";
const Home = () => {
  return (
    <div className="home">
      <section id="name">
        <h1>
          Shawn
          <br />
          Morreau
        </h1>
      </section>
      <h2 className="role anim-typewriter">Software Engineer</h2>
      <section className="callToAction">
        <Button variant="contained" color="primary" className="CTAButton">
          Projects
        </Button>
        <Button variant="contained" color="secondary" className="CTAButton">
          Contact
        </Button>
      </section>
    </div>
  );
};
export default Home;
